import React from "react"
import { MDBRow, MDBCol } from "mdb-react-ui-kit"

export default function Page() {
  return (
    <MDBRow>
      <MDBCol size="md">
        <h5 className="text-light">Games page</h5>
      </MDBCol>
    </MDBRow>
  )
}
